import { TrashIcon } from "@heroicons/react/outline";
import {FontAwesomeIcon} from "@fortawesome/react-fontawesome";
import{faComments, faShareSquare, faPrayingHands} from "@fortawesome/free-solid-svg-icons";

function ReceivedBubble({ReceivedMessage}) {
    return (
        <div className="bg-transparent flex justify-start space-x-4 items-center">



            <div className="flex justify-start p-1 text-sm font-light">
                <div className="p-3 max-w-xs bg-gray-100 rounded-t-xl rounded-br-xl bg-gray-100 text-gray-600">
                    <p>{ReceivedMessage}</p>
                </div>

            </div>
            <div className="flex justify-center items-center bg-gray-100 rounded-full h-10 w-10 hover:bg-cyan-400 group cursor-pointer">
                <FontAwesomeIcon icon={faPrayingHands} size ={'2x'} className="group-hover:text-white text-gray-400 p-1.5"/>
            </div>

            <div className="flex justify-center items-center bg-gray-100 rounded-full h-10 w-10 hover:bg-cyan-400 group cursor-pointer">
                <TrashIcon className="group-hover:text-gray-200 text-gray-400 p-1.5"/>
            </div>

        </div>

    )
}

export default ReceivedBubble;
